import React, { useState } from 'react';
import { Card, CardActions, CardContent, CardMedia, Button, Typography, ButtonBase } from '@material-ui/core/';
import ThumbUpAltIcon from '@material-ui/icons/ThumbUpAlt';
import DeleteIcon from '@material-ui/icons/Delete';
import MoreHorizIcon from '@material-ui/icons/MoreHoriz';
import ThumbUpAltOutlined from '@material-ui/icons/ThumbUpAltOutlined';
import { useDispatch } from 'react-redux';
import moment from 'moment';
import { useHistory } from 'react-router-dom';

import useStyles from './styles';

const ProfileCard = ({ post, setCurrentId }) => {
  const user = JSON.parse(localStorage.getItem('profile'));
  const dispatch = useDispatch();
  const history = useHistory();
  const classes = useStyles();

  const userId =  user?.result?._id;
  
  const openPost = (e) => {
    history.push(`/${post._id}`);
  };

  return (
    <Card className={classes.card} raised elevation={6}>
      <ButtonBase
        component="span"
        name="test"
        className={classes.cardAction}
        onClick={openPost}
      >
        <CardMedia className={classes.media} image={post.ProfileDP || 'https://user-images.githubusercontent.com/194400/49531010-48dad180-f8b1-11e8-8d89-1e61320e1d82.png'} title={post.name} />
        <div className={classes.overlay}>
          <Typography variant="h6">{post.name}</Typography>
          
        </div>
        <div className={classes.title}>
        <Typography className={classes.title} gutterBottom variant="h6" component="h6"><b>{post.accounttype}</b></Typography>
        <Divider style={{ margin: '20px 0' }} />
          <Typography className={classes.title} gutterBottom variant="h6" component="h2"><b>{post.accounttype}</b></Typography>

        </div>
        
        
      </ButtonBase>
      
    </Card>
  );
};

export default ProfileCard;
